      overflow-x: hidden;
    }
    h1 {
      font-size: x-large !important;

    }
    a {

    }
    .main-title {
      font-size: 4rem;
      font-weight: 900;
      background: linear-gradient(45deg, #ffd700, #ffed4a, #f1c40f, #f39c12);

      -webkit-text-fill-color: transparent;

      text-align: center;
      margin-bottom: 20px;

    }
    @keyframes goldShimmer {
      0%, 100% { background-position: 0% 50%; }

    }
    .subtitle {
      text-align: center;
      color: rgba(255, 255, 255, 0.7);
      font-size: 1.2rem;
      margin-bottom: 40px;
      font-weight: 300;
    }

      max-width: 600px;
      margin: 0 auto 40px;
    }
    .search-input {

      padding: 20px 60px 20px 25px;
      border: 2px solid rgba(255, 255, 255, 0.1);
      border-radius: 50px;
      font-size: 18px;
      background: rgba(0, 0, 0, 0.4);
      backdrop-filter: blur(20px);
      color: #fff;
      transition: all 0.4s ease;
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.3);
    }
    .search-input:focus {
      outline: none;
      background: rgba(0, 0, 0, 0.6);
      border-color: #00ff88;
      box-shadow: 0 0 0 4px rgba(0, 255, 136, 0.1), 0 20px 40px rgba(0, 0, 0, 0.4);
      transform: translateY(-2px);
    }
    .search-input::placeholder {
      color: rgba(255, 255, 255, 0.5);
    }
    .search-icon {
      position: absolute;
      right: 25px;
      top: 50%;
      transform: translateY(-50%);
      width: 24px;
      height: 24px;
      opacity: 0.6;
      transition: all 0.3s ease;
    }
    .search-input:focus + .search-icon {
      opacity: 1;
      color: #00ff88;
    }
    .leaderboard-container {
      max-width: 900px;
      margin: 0 auto;
    }
    .player-card {
      background: linear-gradient(135deg, rgba(255, 255, 255, 0.05), rgba(255, 255, 255, 0.02));
      backdrop-filter: blur(20px);
      border: 1px solid rgba(255, 255, 255, 0.1);
      border-radius: 20px;
      margin-bottom: 20px;
      padding: 25px;
      transition: all 0.4s cubic-bezier(0.4, 0, 0.2, 1);
      position: relative;
      overflow: hidden;
      box-shadow: 0 10px 30px rgba(0, 0, 0, 0.2);
    }
    .player-card::before {
      content: '';
      position: absolute;
      top: 0;
      left: -100%;
      width: 100%;
      height: 100%;
      background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.03), transparent);
      transition: left 0.6s ease;
    }
    .player-card:hover {
      transform: translateY(-8px) scale(1.02);
      border-color: rgba(0, 255, 136, 0.3);
      box-shadow: 0 25px 50px rgba(0, 0, 0, 0.3), 0 0 0 1px rgba(0, 255, 136, 0.1);
    }
    .player-card:hover::before {
      left: 100%;
    }
    .player-header {
      display: flex;
      align-items: center;
      justify-content: space-between;
      margin-bottom: 15px;
    }
    .rank-badge {
      display: inline-flex;
      align-items: center;
      gap: 8px;
      padding: 8px 16px;
      border-radius: 50px;
      font-weight: 700;
      font-size: 1.1rem;
      background: rgba(255, 255, 255, 0.1);
      border: 1px solid rgba(255, 255, 255, 0.2);

    .rank-1 {

      box-shadow: 0 0 20px rgba(255, 215, 0, 0.4);
    }

      color: #000;

      color: #fff;
      box-shadow: 0 0 20px rgba(205, 127, 50, 0.4);
    }
    .username {

      background: linear-gradient(45deg, #fff, #f8f9fa);
      -webkit-background-clip: text;
      -webkit-text-fill-color: transparent;
      background-clip: text;
    }
    .player-stats {
      display: grid;
      grid-template-columns: repeat(auto-fit, minmax(150px, 1fr));
      gap: 20px;
      margin-top: 15px;
    }
    .stat-item {
      text-align: center;
      padding: 15px;
      background: rgba(0, 0, 0, 0.3);
      border-radius: 15px;
      border: 1px solid rgba(255, 255, 255, 0.1);

    .stat-label {

      color: rgba(255, 255, 255, 0.7);

      letter-spacing: 1px;
      font-weight: 500;

      font-weight: 700;

    let leaderboard = sampleLeaderboardData;
    let filteredLeaderboard = [];
    const itemsPerPage = 15;
    let currentPage = 1;
    let currentExcludeAdmins = true;
    let currentRankMethod = 'rapValue';
    let isLoading = true;

    function formatNumber(number) {
      return number.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
    }

    function calculateWealth(player, rankMethod) {
      const rap = Number(player.rap) || 0;
      const value = Number(player.value) || 0;
      if (rankMethod === 'rap') return rap;
      if (rankMethod === 'value') return value;
      return rap + value;
    }

    async function initializeLeaderboard() {
      // Validate and clean leaderboard data
      leaderboard = leaderboard.filter(player => {
        const isValid = player && typeof player === 'object' && 
                        player.username && typeof player.username === 'string' && 
                        player.user_id && typeof player.user_id === 'string';
        if (!isValid) {
          console.warn('Invalid player data:', {
            username: player?.username,
            user_id: player?.user_id,
            raw: player
          });
        }
        return isValid;
      });

      function assignRanks(players, rankMethod, rankField) {
        return [...players]
          .sort((a, b) => {
            const wealthA = calculateWealth(a, rankMethod);
            const wealthB = calculateWealth(b, rankMethod);
            return wealthB - wealthA || a.user_id.localeCompare(b.user_id);
          })
          .map((player, index) => ({
            ...player,
            [rankField]: index + 1
          }));
      }

      let rankedLeaderboard = assignRanks(leaderboard, 'rap', 'rapRankOriginal');
      rankedLeaderboard = assignRanks(rankedLeaderboard, 'value', 'valueRankOriginal');
      rankedLeaderboard = assignRanks(rankedLeaderboard, 'rapValue', 'rapValueRankOriginal');

      const nonAdminLeaderboard = leaderboard.filter(player => !admins.includes(player.username));
      let nonAdminRanked = assignRanks(nonAdminLeaderboard, 'rap', 'rapRankNonAdmin');
      nonAdminRanked = assignRanks(nonAdminRanked, 'value', 'valueRankNonAdmin');
      nonAdminRanked = assignRanks(nonAdminRanked, 'rapValue', 'rapValueRankNonAdmin');

      leaderboard = rankedLeaderboard.map(player => {
        const nonAdminPlayer = nonAdminRanked.find(p => p.user_id === player.user_id);
        return {
          ...player,
          rapRankNonAdmin: nonAdminPlayer ? nonAdminPlayer.rapRankNonAdmin : null,
          valueRankNonAdmin: nonAdminPlayer ? nonAdminPlayer.valueRankNonAdmin : null,
          rapValueRankNonAdmin: nonAdminPlayer ? nonAdminPlayer.rapValueRankNonAdmin : null
        };
      });

      console.log('RAP + Value Non-Admin Ranks:', nonAdminRanked.map(p => ({
        username: p.username,
        rap: Number(p.rap) || 0,
        value: Number(p.value) || 0,
        total: (Number(p.rap) || 0) + (Number(p.value) || 0),
        rank: p.rapValueRankNonAdmin
      })));

      await filterLeaderboard();
    }

    async function filterLeaderboard() {
      const query = document.getElementById('searchInput').value.toLowerCase();
      const excludeAdmins = document.getElementById('excludeAdmins').checked;
      currentExcludeAdmins = excludeAdmins;

      const rankMethodInput = document.querySelector('input[name="rankMethod"]:checked');
      currentRankMethod = rankMethodInput ? rankMethodInput.value : 'rapValue';

      filteredLeaderboard = leaderboard.filter(player => {
        const username = (player.username || '').toLowerCase();
        const user_id = (player.user_id || '').toLowerCase();
        const matchesSearch = username.includes(query) || user_id.includes(query);
        const isNotAdmin = !admins.includes(player.username || '');
        return matchesSearch && (!excludeAdmins || isNotAdmin);
      });

      let rankField;
      if (currentRankMethod === 'rap') {
        rankField = currentExcludeAdmins ? 'rapRankNonAdmin' : 'rapRankOriginal';
      } else if (currentRankMethod === 'value') {
        rankField = currentExcludeAdmins ? 'valueRankNonAdmin' : 'valueRankOriginal';
      } else {
        rankField = currentExcludeAdmins ? 'rapValueRankNonAdmin' : 'rapValueRankOriginal';
      }
      filteredLeaderboard.sort((a, b) => {
        const rankA = a[rankField] || Infinity;
        const rankB = b[rankField] || Infinity;
        return rankA - rankB;
      });

      currentPage = 1;
      isLoading = false;
      await displayPage(currentPage);
      setupPagination();
    }

    async function displayPage(page) {
      const start = (page - 1) * itemsPerPage;
      const end = start + itemsPerPage;
      const pageItems = filteredLeaderboard.slice(start, end);

      const container = document.getElementById('leaderboardContent');
      container.innerHTML = '';

      if (isLoading) {
        container.innerHTML = `
          <div class="loading">
            <div class="loading-spinner"></div>
            <p>Loading leaderboard data...</p>
          </div>
        `;
        return;
      }

      if (pageItems.length === 0) {
        container.innerHTML = `
          <div class="no-results">
            <div class="no-results-icon">😕</div>
            <p>No players found matching your search criteria.</p>
          </div>
        `;
        return;
      }

      pageItems.forEach((player, index) => {
        let rankField;
        if (currentRankMethod === 'rap') {
          rankField = currentExcludeAdmins && player.rapRankNonAdmin ? 'rapRankNonAdmin' : 'rapRankOriginal';
        } else if (currentRankMethod === 'value') {
          rankField = currentExcludeAdmins && player.valueRankNonAdmin ? 'valueRankNonAdmin' : 'valueRankOriginal';
        } else {
          rankField = currentExcludeAdmins && player.rapValueRankNonAdmin ? 'rapValueRankNonAdmin' : 'rapValueRankOriginal';
        }
        const displayRank = player[rankField] || 'N/A';
        const rankClass = displayRank === 1 ? 'rank-1' : 
                         displayRank === 2 ? 'rank-2' : 
                         displayRank === 3 ? 'rank-3' : '';
        const trophyIcon = displayRank === 1 ? '🏆' : 
                          displayRank <= 10 ? '🥇' : '💰';

        const playerValue = Number(player.value) || 0;

        const playerCard = document.createElement('div');
        playerCard.className = 'player-card';
        playerCard.style.animationDelay = `${index * 0.1}s`;

        playerCard.innerHTML = `
          <div class="player-header">
            <span class="rank-badge ${rankClass}">${trophyIcon} #${displayRank}</span>
            <div class="username">
              <a href="https://www.pekora.zip/users/${player.user_id}/profile" target="_blank" rel="noopener">${player.username || 'Unknown'}</a>
            </div>
          </div>
          <div class="player-stats">
            <div class="stat-item">
              <div class="stat-label">User ID</div>
              <div class="stat-value user-id">${player.user_id || 'N/A'}</div>
            </div>
            <div class="stat-item">
              <div class="stat-label">RAP</div>
              <div class="stat-value rap-value">${formatNumber(Number(player.rap) || 0)}</div>
            </div>
            <div class="stat-item">
              <div class="stat-label">Value</div>
              <div class="stat-value value-value">${formatNumber(playerValue)}</div>
            </div>
          </div>
        `;
        container.appendChild(playerCard);
      });
    }

    function setupPagination() {
      const totalPages = Math.ceil(filteredLeaderboard.length / itemsPerPage) || 1;
      const pagination = document.getElementById('pagination');
      pagination.innerHTML = '';

      if (totalPages <= 1) return;

      const prevBtn = document.createElement('button');
      prevBtn.className = 'page-btn';
      prevBtn.textContent = '◀ Previous';
      prevBtn.disabled = currentPage === 1;
      prevBtn.onclick = () => {
        if (currentPage > 1) {
          currentPage--;
          displayPage(currentPage);
          setupPagination();
        }
      };

      const pageInfo = document.createElement('span');
      pageInfo.className = 'page-info';
      pageInfo.textContent = `Page ${currentPage} of ${totalPages}`;

      const nextBtn = document.createElement('button');
      nextBtn.className = 'page-btn';
      nextBtn.textContent = 'Next ▶';
      nextBtn.disabled = currentPage === totalPages;
      nextBtn.onclick = () => {
        if (currentPage < totalPages) {
          currentPage++;
          displayPage(currentPage);
          setupPagination();
        }
      };

      pagination.appendChild(prevBtn);
      pagination.appendChild(pageInfo);
      pagination.appendChild(nextBtn);
    }

    document.getElementById('searchInput').addEventListener('input', filterLeaderboard);
    document.getElementById('excludeAdmins').addEventListener('change', filterLeaderboard);
    document.querySelectorAll('input[name="rankMethod"]').forEach(input => {
      input.addEventListener('change', filterLeaderboard);
    });

    document.addEventListener('DOMContentLoaded', () => {
      initializeLeaderboard();
    });
  </script>
